import React, { useState, useEffect } from "react";
import NavbarComp from "../../../components/navbar/NavbarComp";
import { io } from "socket.io-client";
import stylechat from "./chat.module.css";
import { Row, Col } from "react-bootstrap";
let socket;

function UserChat() {
  const [Contacts, setContacts] = useState([]);

  useEffect(() => {
    const socket = io("http://localhost:5005");
    socket.on("connection");
    socket.on("message", (item) => {
      console.log(item);
    });
    return () => {
      socket.disconnect();
    };
  }, []);

  return (
    <>
      <NavbarComp />

      <div className={stylechat.container}>
        <Row>
          <Col md={2}></Col>
          <Col md={9}>
            <div className={stylechat.containermessage}></div>

            <input
              type="text"
              name="message"
              className={stylechat.inputmessage}
              placeholder="jawab user dengan sopan.."
            />

            <button className={stylechat.btnchat}>kirim</button>
          </Col>
        </Row>
      </div>
    </>
  );
}

export default UserChat;
